import React, {Component} from 'react'
import BookImage from '../../asserts/js/images'

export class BorrowedBook extends Component {
    render() {
        return (
            <div className="row">
                <div className="col-3">
                    <img src={BookImage[0]}/>
                </div>

                <div className="col-9">
                    <div className="row">
                        <div style={{fontSize: '18px'}}>
                            <label><b>CHẠY ĐUA VỚI ROBOT</b></label>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}
